import '../Components/style.css';

const Create = () => {
  return <>
  <form className="form mt-5" style={{width:"60%" }}> 
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Name</label>
    <input name="name" type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />

  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Email</label>
    <input name="email" type="email" className="form-control" id="exampleInputPassword1" />
  </div>

  <button type="submit" className="btn btn-primary">Submit</button>
</form>
  </>;
};

export default Create;
